function getData() {

    var tree = function(m) {
        var node = { 
                name: '' + (m.name || ' ' ), 
                className: m.constructor.type,
                numberOfFunctions: Functions.own(m).length,
                numberOfProperties: Properties.own(m).length,
                value: 1};
        node.name = node.name.truncate(12)
        // children are not allowed to be empty
        if (m.submorphs && m.submorphs.length > 0) {
            node.children = m.submorphs.collect(function(ea) { return tree(ea) })
        }
        return node
    }
    return tree($world)



}

