function gatherClassNames(data, list) {
    list = list || [];
    if (!data) return list;
    if (!list.include(data.className)) list.push(data.className);
    if (data.children) {
        data.children.each(function(ea) {
            this.gatherClassNames(ea, list)
        }, this)
    }
    return list
}

